"released\";s:2:\"id\";s:5:\"14033\";s:7:\"created\";s:19:\"2019-12-25 14:49:57\";s:7:\"updated\";s:19:\"2020-01-22 10:15:24\";s:11:\"is_released\";b:0;s:3:\"url\";s:387:\"https://api.freemius.com/v1/installs/3785328/updates/14033.zip?is_premium=false&authorization=FSLA+3785328%3AxfqppKunwJK9rtSkQ9BuYmJOeSxPDEVWVpvsX77XIwbHYq2UFjIGT8Bzp10seiKHqRPVnyAUAsCctpUvDMcC6k-muaf3K_bbO-dgfHAvnrICSXkgDtxSr79scN8SJfIDdTfPuO4-GVlEg3sKzywbfWGCOrd-mLi0KxNNFNajBBpJLn_Yq5NkkZWJsgVY22_LKEf0lwZHrIx07CpA3tUElAXN8ptRdFiHZPtiICw2NkLVArJFTKn1RJV8-PfbvdCPZAvQ2XWVyCAjzqd_Dk-UwQ\";s:6:\"readme\";O:8:\"stdClass\":11:{s:4:\"name\";s:38:\"Ivory Search - WordPress Search Plugin\";s:4:\"slug\";s:18:\"add-search-to-menu\";s:4:\"tags\";O:8:\"stdClass\":6:{s:6:\"search\";s:6:\"search\";s:18:\"woocommerce search\";s:18:\"woocommerce search\";s:12:\"image search\";s:12:\"image search\";s:11:\"ajax search\";s:11:\"ajax search\";s:16:\"search shortcode\";s:16:\"search shortcode\";s:11:\"live search\";s:11:\"live search\";}s:8:\"requires\";s:3:\"3.9\";s:6:\"tested\";s:3:\"5.3\";s:10:\"stable_tag\";s:5:\"4.4.6\";s:8:\"sections\";O:8:\"stdClass\":5:{s:11:\"description\";s:7021:\"<p>Ivory Search is a simple to use advanced WordPress search plugin.</p>\n\n<p>It enhances the default WordPress search and also allows you to create new custom search forms.</p>\n\n<p>With Ivory Search, you can create an unlimited number of search forms and configure each search form individually to customize WordPress search and perform different types of searches on site content.</p>\n\n<p>Display the custom search forms on site header, footer, sidebar or widget area, navigation or menu, on pages, posts, custom post types or anywhere on the site using its shortcodes.</p>\n\n<blockquote>\n  <p>Note: The styling of the search form highly depends on how your theme styles it. If your theme does not style search form correctly then to style it get free support from <a href=\"https://ivorysearch.com/support/\">Ivory Search Support</a>.</p>\n</blockquote>\n\n<p>Have any doubt or question?\nFeel free to ask it using <a href=\"https://ivorysearch.com/contact/\">Contact Form</a>.</p>\n\n<h4>Links</h4>\n\n<ul>\n<li><a href=\"https://ivorysearch.com/\">Website</a></li>\n<li><a href=\"https://ivorysearch.com/documentation/\">Documentation</a></li>\n<li><a href=\"https://ivorysearch.com/support/\">Support</a></li>\n<li><a href=\"https://ivorysearch.com/contact/\">Contact Us</a></li>\n</ul>\n\n<p>=Key Features</p>\n\n<ul>\n<li> Search WooCommerce products.</li>\n<li> Search images, files and attachments.</li>\n<li> Customize search form using customizer.</li>\n<li> Search using AJAX search.</li>\n<li> Create unlimited number of search forms.</li>\n<li> Configure each search forms separately.</li>\n<li> Configure search form to search specific content.</li>\n<li> Exclude specific content from search results.</li>\n<li> Display Search Forms anywhere on your site.</li>\n<li> Supports multilingual search.</li>\n<li> Integrates with popular plugins such as WooCommerce, Polylang, bbPress, WPML etc.</li>\n</ul>\n\n<p>=\n=AJAX Search or Live Search</p>\n\n<ul>\n<li> Convert any search form including default search form to AJAX search form.</li>\n<li> Search posts, pages, WooCommerce products, images, files or any custom post type using AJAX search.</li>\n<li> Exclude any specific content from AJAX search.</li>\n</ul>\n\n<p>=\n=Search Form Customizer</p>\n\n<ul>\n<li> Use customizer to change search form colors and its text.</li>\n<li> Choose any search form style from various search forms.</li>\n</ul>\n\n<p>=\n=Search Specific Content</p>\n\n<ul>\n<li> Search specific post types such as post, page, product, attachment, forum etc.</li>\n<li> Search in post title.</li>\n<li> Search in post content.</li>\n<li> Search in post excerpt.</li>\n<li> Search posts having specific category or taxonomy terms.</li>\n<li> Search in category or taxonomy terms title.</li>\n<li> Search in category or taxonomy terms description.</li>\n<li> Search posts having specific custom fields or metadata.</li>\n<li> Search WooCommerce products SKU. [Premium]</li>\n<li> Search WooCommerce products variation. [Premium]</li>\n<li> Search posts created by specific authors. [Premium]</li>\n<li> Search in author Display name and display the posts created by that author.</li>\n<li> Search posts having specific statuses. [Premium]</li>\n<li> Search posts having specific number of comments. [Premium]</li>\n<li> Search in approved comments content.</li>\n<li> Search posts created in specific date.</li>\n<li> Search only password protected posts.</li>\n<li> Search only posts without passwords.</li>\n<li> Search all posts with and without passwords.</li>\n<li> Search specific files, MIME type or media attachments such as images, audio, videos, PDF, documents etc. [Premium]</li>\n<li> Search in the title, caption and description of images, attachments and media.</li>\n<li> Search in multiple languages as the plugin supports multilingual plugins such as Polylang, WPML etc.</li>\n</ul>\n\n<p>=\n=Exclude Specific Content From Search</p>\n\n<ul>\n<li> Exclude specific post types from search.</li>\n<li> Exclude specific posts, pages, WooCommerce Products, Media Attachments, forums or any custom post type from search.</li>\n<li> Do not search in the post title.</li>\n<li> Configure to not search in post content.</li>\n<li> Configure to not search in post excerpt.</li>\n<li> Exclude posts from search having specific category or taxonomy terms.</li>\n<li> Exclude posts from search having specific custom fields or metadata. [Premium]</li>\n<li> Exclude \'out of stock\' WooCommerce products from search. [Premium]</li>\n<li> Exclude posts from search created by specific authors. [Premium]</li>\n<li> Exclude posts from search having specific statuses. [Premium]</li>\n<li> Exclude sticky posts from search.</li>\n<li> Exclude posts from search having specific number of comments.</li>\n<li> Exclude posts from search created before or after specific dates.</li>\n<li> Exclude password protected posts from search.</li>\n<li> Exclude posts from search without passwords.</li>\n<li> Exclude images, audios, videos, PDF, documents, attachments, files, media, file type or MIME type from search. [Premium]</li>\n</ul>\n\n<p>=\n=Control and Extend Search</p>\n\n<ul>\n<li> Display search form in navigation menu and configure its functionality.</li>\n<li> Configure the number of posts to display in search results.</li>\n<li> Highlight search terms on the search results page.</li>\n<li> Order posts in ascending or descending order of date, relevance, id, author, title, type, name, comment count, menu order or entirely random. [Premium]</li>\n<li> Display or hide sticky posts at the top of the search results page.</li>\n<li> Display an error page or list all posts for empty search queries.</li>\n<li> Display search forms only to site administrators while testing, before going live.</li>\n<li> Disable an individual search form or disable searching site wide.</li>\n<li> Configure stop words which are excluded from search.</li>\n<li> Option to add word synonyms to provide more relevant search results.</li>\n<li> Display post_type argument in the search query URL and restrict search to it.</li>\n<li> Search posts having all or any of the selected category or taxonomy terms.</li>\n<li> Display content having any or all the searched terms.</li>\n<li> Fuzzy Matching - Search posts that include the whole search term or search words in the posts that begins or ends with the search term.</li>\n<li> Keyword Stemming - Also searches base word of searched keyword. [Premium]</li>\n</ul>\n\n<blockquote>\n  <p>Note: some of the features are Premium marked as [Premium]. To have access to those features you will need Ivory Search Premium. You can <a href=\"https://ivorysearch.com/pricing/\">get Ivory Search Premium here</a>!</p>\n</blockquote>\n\n<p>We enhanced and re-wrote old Add Search To Menu plugin from the ground up and Add Search To Menu has renamed to Ivory Search.</p>\n\n<h4>Help</h4>\n\n<p>Need Help? Get <a href=\"https://ivorysearch.com/support/\">Ivory Search support</a>.</p>\n\n<h4>Feedback</h4>\n\n<p>Any suggestions or comments are welcome. Feel free to contact us using this <a href=\"https://ivorysearch.com/contact/\">Contact form</a>.</p>\";s:12:\"installation\";s:625:\"<ul>\n<li>Install the plugin from the \'Plugins\' section in your dashboard (Go to <code>Plugins -&gt; Add New -&gt; Search</code> and search for Ivory Search).</li>\n<li>Alternatively, you can <a href=\"https://downloads.wordpress.org/plugin/add-search-to-menu.zip\" title=\"Download Ivory Search\">download</a> the plugin from the repository. Unzip it and upload it to the plugins folder of your WordPress installation (<code>wp-content/plugins/</code> directory of your WordPress installation).</li>\n<li>Activate it through the \'Plugins\' section.</li>\n<li>Use the <code>Ivory Search</code> menu to configure the plugin.</li>\n</ul>\";s:3:\"faq\";s:2145:\"<h4>How to use Ivory Search plugin?</h4>\n\n<p>Please read below documentation to know how to use Ivory Search plugin.</p>\n\n<p><a href=\"https://ivorysearch.com/docs/how-to-use-ivory-search-plugin/\">https://ivorysearch.com/docs/how-to-use-ivory-search-plugin/</a></p>\n\n<h4>Is the plugin compatible with WooCommerce?</h4>\n\n<p>Yes the Ivory Search plugin integrates directly with WooCommerce to provide a powerful and advanced WooCommerce Search. Not only can you use Fuzzy searching, you can exclude specific WooCommerce products from search, include specific WooCommerce products in your search and much more.</p>\n\n<p>If you need more advanced WooCommerce Search functionality, upgrade to <a href=\"https://ivorysearch.com/pricing/\">Ivory Search Premium</a> which provides WooCommerce SKU searching and even more powerful WooCommerce Search functionality.</p>\n\n<h4>Can I add search to menu?</h4>\n\n<p>Yes you can easily add your search to menu in just a couple of clicks, be up and running in minutes.</p>\n\n<h4>Does the plugin provide search shortcodes?</h4>\n\n<p>Yes Ivory Search provides a range of search shortcodes you can use, best of all you can create an unlimited number of custom search forms and then embed them on your WordPress site using our powerful and easy to use range of Search Shortcodes.</p>\n\n<h4>Does the plugin provide search widgets?</h4>\n\n<p>Yes it provides search widgets. Using Ivory Search you can add a custom search widget to your WordPress powered website quickly and easily, with minimal hassle. To use it simply add your custom search form then head on over to your widgets area and add ivory search widget in widget area.</p>\n\n<h4>Will the custom search work with my theme?</h4>\n\n<p>Yes. Ivory Search, has been tested and works perfectly with a range of themes, including but by no means limited to Divi, allowing you to build a custom search with Divi, Avada, X and Pro by Themeco, GeneratePress, OceanWP and many more.</p>\n\n<h4>Do You Offer Customization Support?</h4>\n\n<p>Yes we do. We try our best to help free users with customisation requests and we offer guaranteed CSS customisations for our premium users.</p>\";s:9:\"changelog\";s:6679:\"<h4>4.4.6</h4>\n\n<ul>\n<li>Fixed - AJAX search results some options not working.</li>\n</ul>\n\n<h4>4.4.5</h4>\n\n<ul>\n<li>Improved - Made SVG icons Accessibility Ready.</li>\n<li>Improved - Search dropdown should not close on clicking on AJAX search results.</li>\n<li>Fixed - AJAX search results Undefined index notices.</li>\n</ul>\n\n<h4>4.4.4</h4>\n\n<ul>\n<li>Fixed - Search form AJAX options not working.</li>\n</ul>\n\n<h4>4.4.3</h4>\n\n<ul>\n<li>Fixed - AJAX search results displaying out of viewport.</li>\n<li>Fixed - AJAX search results Undefined index notices.</li>\n<li>Fixed - AJAX search results displays on wrong location on scroll.</li>\n<li>Fixed - Searching exact words with \" \" quote marks.</li>\n</ul>\n\n<h4>4.4.2</h4>\n\n<ul>\n<li>Improved - Ajax search results scrolls with search form.</li>\n<li>Added - is_search_form_autocomplete filter to remove autocomplete from search field.</li>\n<li>Added - Retains \'lang\' parameter in the search results query string.</li>\n<li>Fixed - Ivory Search Widget title was not getting removed.</li>\n<li>Fixed - Database error occurred due to hardcode prefix.</li>\n<li>Fixed - Search more than 9 terms with OR condition.</li>\n<li>Fixed - Shortcodes are displaying in the AJAX search results.</li>\n<li>Fixed - \"Search button displays ajax search results\" option does not work for the AJAX search form without button.</li>\n<li>Fixed - AJAX search not working on some mobiles.</li>\n</ul>\n\n<h4>4.4.1</h4>\n\n<ul>\n<li>Fixed - Menu search popup was not working in the plugin free version.</li>\n<li>Fixed - Search results text highlight issue.</li>\n<li>Fixed - Default search results was not ordered to date DESC.</li>\n<li>Fixed - Some free plugin options were displaying premium.</li>\n<li>Fixed - Post status was not getting set in the free version.</li>\n<li>Removed - Legacy add-search-to-menu fallback code.</li>\n</ul>\n\n<h4>4.4</h4>\n\n<ul>\n<li>Improved - Plugin admin options user interface.</li>\n<li>Added - Option \"Do not display post_type in the search URL\".</li>\n<li>Added - Filter to change image size in AJAX search results.</li>\n<li>Fixed - Menu search form not getting saved.</li>\n<li>Fixed - AJAX search results dispalying WPBakery plugin shortcodes</li>\n<li>Fixed - AJAX Show More Results section not disabling.</li>\n<li>Fixed - Add New Search Form screen Undefined index error.</li>\n<li>Fixed - Edit search form link position issue.</li>\n<li>Fixed - AJAX More Results text show / hide issue.</li>\n<li>Fixed - List of post saving issue and DISABLE_IS_LOAD_ALL not working issue.</li>\n<li>Moved - Menu Search section as a second section.</li>\n<li>Changed - Synonyms separator from semicolon to new line.</li>\n<li>Removed - Post status option from the search form Excludes section.</li>\n<li>Free - Made the premium option free - Search All Or Any Search Terms.</li>\n<li>Free - Made the premium option free - Menu search form selection.</li>\n</ul>\n\n<h4>4.3.3</h4>\n\n<ul>\n<li>Fixed - header already sent issue displayed in the search forms admin page.</li>\n<li>Fixed - Default style menu search form width issue.</li>\n<li>Made Free - Menu search form Popup style.</li>\n<li>Removed - \"Disable synonyms for the search forms configured to search all search terms\" option.</li>\n</ul>\n\n<h4>4.3.2</h4>\n\n<ul>\n<li>Improved - Plugin admin area functionality.</li>\n</ul>\n\n<h4>4.3.1</h4>\n\n<ul>\n<li>Added - DISABLE_IS_LOAD_ALL constant.</li>\n<li>Fixed - query_vars, wp_is_json_request &amp; wp_doing_ajax issues.</li>\n<li>Removed - Add New sub menu &amp; display post type in the search query URL options.</li>\n</ul>\n\n<h4>4.3</h4>\n\n<ul>\n<li>Added AJAX search and search form customizer functionalities.</li>\n</ul>\n\n<h4>4.2.1</h4>\n\n<ul>\n<li>Updated - freemius SDK.</li>\n<li>Fixed - new search form saving issue.</li>\n</ul>\n\n<h4>4.2</h4>\n\n<ul>\n<li>Enhanced plugin admin settings user interface.</li>\n<li>Developed functionality to search posts and pages along with media.</li>\n</ul>\n\n<h4>4.1.7</h4>\n\n<ul>\n<li>Fixed - Post title and content options saving issue.</li>\n</ul>\n\n<h4>4.1.6</h4>\n\n<ul>\n<li>Fixed -  Post type issue when reset search form.</li>\n<li>Styled - Twenty Nineteen theme search form.</li>\n<li>Fixed - New search form tabs issue.</li>\n</ul>\n\n<h4>4.1.5</h4>\n\n<ul>\n<li>Fixed - Firefox browser right mouse click closing search form issue.</li>\n</ul>\n\n<h4>4.1.4</h4>\n\n<ul>\n<li>Searches in WooCommerce products variation.</li>\n<li>Fixed - Firefox browser dropdown select issue.</li>\n<li>Optimized plugin admin options.</li>\n</ul>\n\n<h4>4.1.3</h4>\n\n<ul>\n<li>Developed option to search specific posts, pages or custom post types.</li>\n</ul>\n\n<h4>4.1.2</h4>\n\n<ul>\n<li>Menu search post types can be managed now from search form post types option.</li>\n</ul>\n\n<h4>4.1.1</h4>\n\n<ul>\n<li>Developed reset button to reset search form.</li>\n<li>Designed new switch control UI for plugin settings page.</li>\n<li>Developed functionality to display plugin options changed indicator.</li>\n</ul>\n\n<h4>4.1</h4>\n\n<ul>\n<li>Improved plugin settings User Interface.</li>\n<li>Added compatibility with Polylang plugin.</li>\n</ul>\n\n<h4>4.0.1</h4>\n\n<ul>\n<li>Fixed menu search form attachment search issue.</li>\n</ul>\n\n<h4>4.0</h4>\n\n<ul>\n<li>Renamed plugin from \"Add Search To Menu\" to \"Ivory Search\".</li>\n<li>Changed old settings page from Settings -> Add Search To Menu to Ivory Search -> Settings</li>\n<li>Added new Popup menu search form style.</li>\n<li>Developed option to created unlimited search forms and each search forms can be configured separately.</li>\n<li>Search specific post types, categories, taxonomies, terms, custom fields, authors, comments and many more.</li>\n<li>Exclude from search specific posts, pages, categories, taxonomies, terms, custom fields, authors, post status and many more.</li>\n<li>Developed options for searched posts ordering, Terms Highlighting, Fuzzy Matching, Keyword Stemming and many more.</li>\n</ul>\n\n<h4>3.4</h4>\n\n<ul>\n<li>Resolved \"PHP Notice: Undefined index: add_search_to_menu_style\"</li>\n</ul>\n\n<h4>3.3</h4>\n\n<ul>\n<li>Enhanced Mobile Display option to work with caching.</li>\n</ul>\n\n<h4>3.2</h4>\n\n<ul>\n<li>Fixed incorrect JavaScript and CSS files URLs displayed in the plugin settings.</li>\n<li>Fixed issue of using quotation in plugin custom CSS option.</li>\n</ul>\n\n<h4>3.1</h4>\n\n<ul>\n<li>Resolved search icon background color issue.</li>\n<li>Added search form close icon to close search form.</li>\n</ul>\n\n<h4>3.0</h4>\n\n<ul>\n<li>Added plugin options Search Post Types, Google CSE, Mobile Display and Custom CSS.</li>\n<li>Styled it for default WordPress themes.</li>\n</ul>\n\n<h4>2.0</h4>\n\n<ul>\n<li>Resolved scrolling issue in fixed menu and made magnifying glass icon resizable.</li>\n</ul>\n\n<h4>1.0</h4>\n\n<p>=\n* Initial release.</p>\";s:11:\"screenshots\";s:0:\"\";}s:14:\"upgrade_notice\";b:0;s:11:\"donate_link\";s:33:\" https://ivorysearch.com/pricing/\";s:7:\"version\";s:5:\"4.4.6\";s:13:\"download_link\";s:387:\"https://api.freemius.com/v1/installs/3785328/updates/14033.zip?is_premium=false&authorization=FSLA+3785328%3AxfqppKunwJK9rtSkQ9BuYmJOeSxPDEVWVpvsX77XIwbHYq2UFjIGT8Bzp10seiKHqRPVnyAUAsCctpUvDMcC6k-muaf3K_bbO-dgfHAvnrICSXkgDtxSr79scN8SJfIDdTfPuO4-GVlEg3sKzywbfWGCOrd-mLi0KxNNFNajBBpJLn_Yq5NkkZWJsgVY22_LKEf0lwZHrIx07CpA3tUElAXN8ptRdFiHZPtiICw2NkLVArJFTKn1RJV8-PfbvdCPZAvQ2XWVyCAjzqd_Dk-UwQ\";}}s:7:\"created\";i:1579692754;s:9:\"timestamp\";i:1579696354;}s:68:\"get:/v1/users/2600677/plugins/2086/payments.json?include_addons=true\";O:8:\"stdClass\":3:{s:6:\"result\";O:8:\"stdClass\":1:{s:8:\"payments\";a:0:{}}s:7:\"created\";i:1579692754;s:9:\"timestamp\";i:1579779154;}}', 'yes'),
